                        <img></img>
                    </section>
                    <section className='coluna1'>
                        <p className='abaAzul'>Adicionar Funcionário </p>
                        <section className='coluna coluna2'>
                            <p>Nome</p>
                            <Input/>
                            <p>CPF</p>
                            <Input/>
